import React from 'react';
import { BrowserRouter, Route } from "react-router-dom";
import './App.css';
import App from "./App";
import Home from "./home";

function Auth() {
    return (
        <div className="App">
            <BrowserRouter>
                <Route path="/" element={<App />} />
                <Route path="home" element={<Home />} />
            </BrowserRouter>
        </div>
    );
}

export default Auth;
